import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { ContextProvider, Context } from './context/Context';

ReactDOM.render(
    <React.StrictMode >
        <ContextProvider>
            <App />
        </ContextProvider>
    </React.StrictMode>,
    document.getElementById('root')
);
